    'Ketones and quinones, whether or not with other oxygen function, and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Ketoni un hinoni, kas satur vai nesatur vēl kādu skābekļa funkcionālo grupu, un to halogenētie, sulfurētie, nitrētie vai nitrozētie atvasinājumi',
    'Saturated acyclic monocarboxylic acids and their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Piesātinātas acikliskās monokarbonskābes un to anhidrīdi, halogenīdi, peroksīdi un peroksiskābes; šo savienojumu halogenētie, sulfurētie, nitrētie vai nitrozētie atvasinājumi',
    'Unsaturated acyclic monocarboxylic acids, cyclic monocarboxylic acids, their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Nepiesātinātās acikliskās monokarbonskābes, cikliskās monokarbonskābes un to anhidrīdi, halogenīdi, peroksīdi un peroksiskābes; šo savienojumu halogenētie, sulfurētie, nitrētie vai nitrozētie atvasinājumi',
    'Polycarboxylic acids, their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Polikarbonskābes un to anhidrīdi, halogenīdi, peroksīdi un peroksiskābes; šo savienojumu halogenētie, sulfurētie, nitrētie vai nitrozētie atvasinājumi',
    'Carboxylic acids with additional oxygen function and their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Karbonskābes, kas satur papildu skābekļa funkcionālās grupas, un to anhidrīdi, halogenīdi, peroksīdi un peroksiskābes; šo savienojumu halogenētie, sulfurētie, nitrētie vai nitrozētie atvasinājumi',
    'Phosphoric esters and their salts, including lactophosphates; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Fosforskābes esteri un to sāļi, ieskaitot laktofosfātu; to halogenētie, sulfurētie, nitrētie vai nitrozētie atvasinājumi',
    'Esters of other inorganic acids of non-metals (excluding esters of hydrogen halides) and their salts; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Nemetālu pārējo neorganisko skābju esteri (izņemot halogēnūdeņražu esterus) un to sāļi; šo savienojumu halogenētie, sulfurētie, nitrētie vai nitrozētie atvasinājumi',
    'Amine-function compounds' => 'Savienojumi ar amīnu funkcionālajām grupām',
    'Oxygen-function amino-compounds' => 'Aminosavienojumi, kas satur skābekļa funkcionālo grupu',
    'Quaternary ammonium salts and hydroxides; lecithins and other phosphoaminolipids, whether or not chemically defined' => 'Četraizvietotie amonija sāļi un hidroksīdi; lecitīni un citi fosfoaminolipīdi ar ķīmiski noteiktu vai nenoteiktu sastāvu',
    'Carboxyamide-function compounds; amide-function compounds of carbonic acid' => 'Savienojumi, kas satur karboksiamīda funkcionālo grupu; ogļskābes savienojumi, kas satur amīda funkcionālo grupu',
    'Carboxyimide-function compounds (including saccharin and its salts) and imine-function compounds' => 'Savienojumi, kas satur karboksiimīda funkcionālo grupu (ieskaitot saharīnu un tā sāļus), un savienojumi, kas satur imīna funkcionālo grupu',
    'Nitrile-function compounds' => 'Savienojumi, kas satur nitrila funkcionālo grupu',
    'Compounds with other nitrogen function' => 'Savienojumi, kas satur citas slāpekļa funkcionālās grupas',
    'Organo-sulphur compounds' => 'Sēra organiskie savienojumi',
    'Other organo-inorganic compounds' => 'Citādi elementorganiskie savienojumi',
    'Heterocyclic compounds with oxygen hetero-atom(s) only' => 'Heterocikliskie savienojumi, kas satur tikai skābekļa heteroatomu(-us)',
    'Heterocyclic compounds with nitrogen hetero-atom(s) only' => 'Heterocikliskie savienojumi, kas satur tikai slāpekļa heteroatomu(-us)',
    'Nucleic acids and their salts, whether or not chemically defined; other heterocyclic compounds' => 'Nukleīnskābes un to sāļi, arī ar nenoteiktu ķīmisko sastāvu; citādi heterocikliskie savienojumi',
    'Sulphonamides' => 'Sulfonamīdi',
    'Provitamins and vitamins, natural or reproduced by synthesis (including natural concentrates), derivatives thereof used primarily as vitamins, and intermixtures of the foregoing, whether or not in any solvent' => 'Dabiskie un sintezētie provitamīni un vitamīni (ieskaitot dabiskos koncentrātus), to atvasinājumi, ko izmanto galvenokārt kā vitamīnus, un šo savienojumu maisījumi, arī šķīdinātājā',
    'Hormones, prostaglandins, thromboxanes and leukotrienes, natural or reproduced by synthesis; derivatives and structural analogues thereof, including chain modified polypeptides, used primarily as hormones' => 'Dabiskie vai sintezētie hormoni, prostaglandīni, tromboksāni un leikotrīni; to atvasinājumi un struktūras analogi, arī polipeptīdi ar modificētu ķēdi, kurus izmanto galvenokārt kā hormonus',
    'Glycosides, natural or reproduced by synthesis, and their salts, ethers, esters and other derivatives' => 'Dabiskie vai sintezētie glikozīdi un to sāļi, ēteri un esteri un citādi atvasinājumi',
    'Alkaloids, natural or reproduced by synthesis, and their salts, ethers, esters and other derivatives' => 'Dabiskie vai sintezētie alkaloīdi un to sāļi, ēteri un esteri un citādi atvasinājumi',
    'Antibiotics' => 'Antibiotikas',
    'Glands and other organs for organo-therapeutic uses, dried, whether or not powdered; extracts of glands or other organs or of their secretions for organo-therapeutic uses; heparin and its salts; other human or animal substances prepared for therapeutic or prophylactic uses, not elsewhere specified or included' => 'Dziedzeri un citi orgāni ārstnieciskām vajadzībām, izkaltēti, sasmalcināti vai nesasmalcināti pulverī; dziedzeru vai citu orgānu ekstrakti vai to sekrētu ekstrakti ārstnieciskām vajadzībām; heparīns un tā sāļi; citas cilvēku vai dzīvnieku izcelsmes vielas, kas sagatavotas ārstnieciskām vai profilakses vajadzībām un citur nav minētas',
    'Human blood; animal blood prepared for therapeutic, prophylactic or diagnostic uses; antisera, other blood fractions and immunological products, whether or not modified or obtained by means of biotechnological processes; vaccines, toxins, cultures of micro-organisms (excluding yeasts) and similar products; cell cultures, whether or not modified' => 'Cilvēka asinis; dzīvnieku asinis, kas sagatavotas ārstniecības, profilakses vai diagnostikas vajadzībām; imūnserumi, citādas asins frakcijas un imūnpreparāti, kuri ir vai nav modificēti vai iegūti biotehnoloģiskos procesos; vakcīnas, toksīni, mikroorganismu kultūras (izņemot raugus) un tamlīdzīgi produkti; šūnu kultūras, arī modificētas',
    'Medicaments (excluding goods of heading 3002, 3005 or 3006) consisting of two or more constituents which have been mixed together for therapeutic or prophylactic uses, not put up in measured doses or in forms or packings for retail sale' => 'Medikamenti (izņemot pozīcijās 3002, 3005, 3006 minētos), kas sastāv no diviem vai vairākiem ārstnieciskām vai profilaktiskām vajadzībām sajauktiem komponentiem, bet nav safasēti nomērītās devās vai iepakoti mazumtirdzniecībai',
    'Medicaments (excluding goods of heading 3002, 3005 or 3006) consisting of mixed or unmixed products for therapeutic or prophylactic uses, put up in measured doses (including those in the form of transdermal administration systems) or in forms or packings for retail sale' => 'Medikamenti (izņemot pozīcijās 3002, 3005, 3006 minētos izstrādājumus), kas sastāv no ārstnieciskām vai profilaktiskām vajadzībām sajauktiem vai nesajauktiem produktiem, kuri ir safasēti nomērītās devās (ieskaitot devas ievadīšanai zem ādas) vai iepakoti mazumtirdzniecībai',
    'Wadding, gauze, bandages and similar articles (for example, dressings, adhesive plasters, poultices), impregnated or coated with pharmaceutical substances or put up in forms or packings for retail sale for medical, surgical, dental or veterinary purposes' => 'Vate, marle, pārsēji un tamlīdzīgi materiāli (piemēram, pārsienamie materiāli, leikoplasti, sautējošas kompreses), kas piesūcināti vai pārklāti ar farmaceitiskām vielām vai safasēti vai iepakoti mazumtirdzniecībai un paredzēti medicīnas, ķirurģijas, zobārstniecības vai veterinārijas vajadzībām',
    'Pharmaceutical goods specified in note 4 to this chapter' => 'Farmācijas izstrādājumi, kas minēti šīs nodaļas 4. piezīmē',
    'Mineral or chemical fertilisers, nitrogenous' => 'Minerālie vai ķīmiskie slāpekļa mēslošanas līdzekļi',
    'Mineral or chemical fertilisers, phosphatic' => 'Minerālie vai ķīmiskie fosfora mēslošanas līdzekļi',
    'Mineral or chemical fertilisers, potassic' => 'Minerālie vai ķīmiskie kālija mēslošanas līdzekļi',
    'Mineral or chemical fertilisers containing two or three of the fertilising elements nitrogen, phosphorus and potassium; other fertilisers; goods of this chapter in tablets or similar forms or in packages of a gross weight not exceeding 10 kg' => 'Minerālie vai ķīmiskie mēslošanas līdzekļi, kas satur divus vai trīs barojošus elementus: slāpekli, fosforu un kāliju; citādi mēslošanas līdzekļi; šajā nodaļā minētie izstrādājumi tabletēs vai tamlīdzīgās formās vai iepakojumos, kuru bruto svars nepārsniedz 10 kg',
    'Tanning extracts of vegetable origin; tannins and their salts, ethers, esters and other derivatives' => 'Augu izcelsmes miecvielu ekstrakti; tanīni un to sāļi, ēteri un esteri un citādi atvasinājumi',
    'Synthetic organic tanning substances; inorganic tanning substances; tanning preparations, whether or not containing natural tanning substances; enzymatic preparations for pre-tanning' => 'Sintētiskās organiskās miecvielas; neorganiskās miecvielas; miecēšanas preparāti, kas satur vai nesatur dabiskās miecvielas; fermentu preparāti sākotnējai miecēšanai',
    'Colouring matter of vegetable or animal origin (including dyeing extracts but excluding animal black), whether or not chemically defined; preparations as specified in note 3 to this chapter based on colouring matter of vegetable or animal origin' => 'Augu vai dzīvnieku izcelsmes krāsvielas (ieskaitot krāsošanas ekstraktus, bet izņemot dzīvnieku ogli) ar noteiktu vai nenoteiktu ķīmisko sastāvu; šīs nodaļas 3. piezīmē minētie preparāti uz augu vai dzīvnieku izcelsmes krāsvielu bāzes',
    'Synthetic organic colouring matter, whether or not chemically defined; preparations as specified in note 3 to this chapter based on synthetic organic colouring matter; synthetic organic products of a kind used as fluorescent brightening agents or as luminophores, whether or not chemically defined' => 'Sintētiskās organiskās krāsvielas ar noteiktu vai nenoteiktu ķīmisko sastāvu; šīs nodaļas 3. piezīmē minētie preparāti uz sintētisko organisko krāsvielu bāzes; sintētiskie organiskie produkti, ko izmanto par fluorescējošiem balinātājiem vai luminoforiem, ar noteiktu vai nenoteiktu ķīmisko sastāvu',
    'Other colouring matter; preparations as specified in note 3 to this chapter, other than those of heading 3203, 3204 or 3205; inorganic products of a kind used as luminophores, whether or not chemically defined' => 'Citādas krāsvielas; preparāti, kas minēti šīs nodaļas 3. piezīmē, izņemot pozīcijās 3203, 3204 vai 3205 minētos; neorganiskie produkti, ko izmanto kā luminoforus, ar noteiktu vai nenoteiktu ķīmisko sastāvu',
    'Prepared pigments, prepared opacifiers and prepared colours, vitrifiable enamels and glazes, engobes (slips), liquid lustres and similar preparations, of a kind used in the ceramic, enamelling or glass industry; glass frit and other glass, in the form of powder, granules or flakes' => 'Gatavi pigmenti, gatavas opalescentas vielas un gatavas krāsas, stiklveida emaljas un glazūras, angobas jeb aplējumi, šķidrie spīdumi (lustri) un tamlīdzīgi preparāti, ko izmanto keramikā, emaljēšanai vai stikla ražošanā; stikla frite un citāds stikls pulveru, granulu vai pārslu veidā',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in a non-aqueous medium; solutions as defined in note 4 to this chapter' => 'Krāsas un lakas (ieskaitot emaljas un glazūras) uz sintētisko polimēru vai ķīmiski modificētu dabisko polimēru bāzes, disperģētas vai izšķīdinātas neūdens vidē; šķīdumi, kas minēti šīs nodaļas 4. piezīmē',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in an aqueous medium' => 'Krāsas un lakas (ieskaitot emaljas un spožos pārklājumus) uz sintētisko polimēru vai ķīmiski apstrādātu dabisko polimēru bāzes, disperģētas vai izšķīdinātas ūdens vidē',
    'Other paints and varnishes (including enamels, lacquers and distempers); prepared water pigments of a kind used for finishing leather' => 'Citādas krāsas un lakas (ieskaitot emaljas, spožos pārklājumus un līmes krāsas); gatavi ūdenī šķīstoši krāsu pigmenti, ko izmanto ādas apretēšanai',
    'Pigments (including metallic powders and flakes) dispersed in non-aqueous media, in liquid or paste form, of a kind used in the manufacture of paints (including enamels); stamping foils; dyes and other colouring matter put up in forms or packings for retail sale' => 'Pigmenti (ieskaitot metāla pulverus un kristālus), disperģēti neūdens vidē, šķidruma vai pastas veidā, ko izmanto krāsu (ieskaitot emaljas) ražošanā; spieduma folijas; citādas krāsvielas, safasētas mazumtirdzniecībai',
    'Artists\', students\' or signboard painters\' colours, modifying tints, amusement colours and the like, in tablets, tubes, jars, bottles, pans or in similar forms or packings' => 'Krāsas māksliniekiem, skolniekiem vai plakātu krāsas, pārvelkoša krāsojuma krāsas, krāsas izklaidei un tamlīdzīgas krāsas tabletēs, tūbiņās, burciņās, pudelēs, bļodiņās vai tamlīdzīgās formās vai iepakojumos',
    'Glaziers\' putty, grafting putty, resin cements, caulking compounds and other mastics; painters\' fillings; non-refractory surfacing preparations for façades, indoor walls, floors, ceilings or the like' => 'Stiklinieku tepe, potvasks, sveķu cementi, blīvēšanas maisījumi un citas mastikas; krāsotāju špakteļtepes; fasāžu, iekšējo sienu, grīdu, griestu vai tamlīdzīgu virsmu apstrādes ugunsnedroši maisījumi',
    'Printing ink, writing or drawing ink and other inks, whether or not concentrated or solid' => 'Tipogrāfijas krāsas, tinte vai tuša un citas tintes, arī koncentrētas, šķidras vai cietas',
    'Essential oils (terpeneless or not), including concretes and absolutes; resinoids; extracted oleoresins; concentrates of essential oils in fats, in fixed oils, in waxes or the like, obtained by enfleurage or maceration; terpenic by-products of the deterpenation of essential oils; aqueous distillates and aqueous solutions of essential oils' => 'Ēteriskās eļļas (atbrīvotas vai neatbrīvotas no terpēniem), ieskaitot konkrēteļļas un absolūteļļas; rezinoīdi; ekstrahēti oleosveķi; ēterisko eļļu koncentrāti taukos, negaistošās eļļās, vaskos un tamlīdzīgās vielās, kas iegūti ar tvaiku absorbēšanu vai macerāciju; terpēnu blakusprodukti, kas radušies, atbrīvojot ēteriskās eļļas no terpēniem; ēterisko eļļu ūdens destilāti un ūdens šķīdumi',
    'Mixtures of odoriferous substances and mixtures (including alcoholic solutions) with a basis of one or more of these substances, of a kind used as raw materials in industry; other preparations based on odoriferous substances, of a kind used for the manufacture of beverages' => 'Smaržvielu maisījumi un maisījumi (ieskaitot spirta šķīdumus) uz vienas vai vairāku šādu vielu bāzes, kurus izmanto kā rūpniecības izejvielas; citādi izstrādājumi uz smaržvielu bāzes, kurus izmanto dzērienu ražošanā',
    'Perfumes and toilet waters' => 'Smaržas (parfīmi) un tualetes ūdeņi',
    'Beauty or make-up preparations and preparations for the care of the skin (other than medicaments), including sunscreen or suntan preparations; manicure or pedicure preparations' => 'Kosmētikas vai dekoratīvās kosmētikas līdzekļi un ādas kopšanas līdzekļi (izņemot medikamentozos), ieskaitot pretiedeguma un iedeguma līdzekļus; manikīra vai pedikīra līdzekļi',
    'Preparations for use on the hair' => 'Matu kopšanas līdzekļi',
    'Preparations for oral or dental hygiene, including denture fixative pastes and powders; yarn used to clean between the teeth (dental floss), in individual retail packages' => 'Mutes dobuma vai zobu higiēnas līdzekļi, ieskaitot protēžu fiksēšanas pastas un pulverus; zobu diegs (vaskots diegs zobstarpu tīrīšanai), atsevišķā mazumtirdzniecības iepakojumā',
    'Pre-shave, shaving or aftershave preparations, personal deodorants, bath preparations, depilatories and other perfumery, cosmetic or toilet preparations, not elsewhere specified or included; prepared room deodorisers, whether or not perfumed or having disinfectant properties' => 'Pirms skūšanās, pēc skūšanās vai skūšanās laikā izmantojamie līdzekļi, ķermeņa dezodoranti, vannošanās līdzekļi, depilācijas un citādi parfimērijas, kosmētikas vai ķermeņa kopšanas līdzekļi, kas citur nav minēti vai ietverti; telpu dezodoranti, arī aromatizēti vai ar dezinficējošām īpašībām',
    'Soap; organic surface-active products and preparations for use as soap, in the form of bars, cakes, moulded pieces or shapes, whether or not containing soap; organic surface-active products and preparations for washing the skin, in the form of liquid or cream and put up for retail sale, whether or not containing soap; paper, wadding, felt and nonwovens, impregnated, coated or covered with soap or detergent' => 'Ziepes; organiskās virsmaktīvās vielas un līdzekļi, ko izmanto kā ziepes, stieņos, gabalos vai figūru veidā un kas satur vai nesatur ziepes; organiskās virsmaktīvās vielas un līdzekļi ķermeņa mazgāšanai, šķidri vai krēmveida, safasēti mazumtirdzniecībai, kuri satur vai nesatur ziepes; papīrs, vate, filcs un neaustās drānas, piesūcināti, pārklāti vai apsmidzināti ar ziepēm vai mazgāšanas līdzekļiem',
    'Organic surface-active agents (other than soap); surface-active preparations, washing preparations (including auxiliary washing preparations) and cleaning preparations, whether or not containing soap, other than those of heading 3401' => 'Organiskās virsmaktīvās vielas (izņemot ziepes); virsmaktīvie līdzekļi, mazgāšanas līdzekļi (ieskaitot mazgāšanas palīglīdzekļus) un tīrīšanas līdzekļi, kas satur vai nesatur ziepes, izņemot pozīcijā 3401 minētos',
    'Lubricating preparations (including cutting-oil preparations, bolt or nut release preparations, anti-rust or anti-corrosion preparations and mould-release preparations, based on lubricants) and preparations of a kind used for the oil or grease treatment of textile materials, leather, furskins or other materials, but excluding preparations containing, as basic constituents, 70 % or more by weight of petroleum oils or of oils obtained from bituminous minerals' => 'Eļļošanas līdzekļi (ieskaitot griezējinstrumentu eļļošanas, skrūvju un uzgriežņu vītņu eļļošanas, rūsas noņemšanas vai pretkorozijas līdzekļus un veidņu eļļas un līdzekļus, kas izgatavoti uz eļļošanas līdzekļu bāzes), līdzekļi, ko izmanto tekstilmateriālu, ādu, kažokādu, citu materiālu apstrādei ar taukiem vai eļļām, bet izņemot līdzekļus, kuros kā pamatkomponents 70 % no svara vai vairāk ir naftas eļļas vai eļļas, kas iegūtas no bitumenminerāliem',
    'Artificial waxes and prepared waxes' => 'Mākslīgie un gatavie vaski',
    'Polishes and creams, for footwear, furniture, floors, coachwork, glass or metal, scouring pastes and powders and similar preparations (whether or not in the form of paper, wadding, felt, nonwovens, cellular plastics or cellular rubber, impregnated, coated or covered with such preparations), excluding waxes of heading 3404' => 'Apavu, mēbeļu, grīdas, transporta iekārtu, stikla vai metālu pulēšanas līdzekļi un krēmi, tīrīšanas pastas un pulveri un tamlīdzīgi līdzekļi (arī papīra, vates, filca, neaustu drānu, porainas plastmasas vai porainas gumijas formā, piesūcināti, pārklāti vai apsmidzināti ar šiem līdzekļiem), izņemot vaskus, kas minēti pozīcijā 3404',
    'Casein, caseinates and other casein derivatives; casein glues' => 'Kazeīns, kazeināti un citi kazeīna atvasinājumi; kazeīna līmes',
    'Albumins (including concentrates of two or more whey proteins, containing by weight more than 80 % whey proteins, calculated on the dry matter), albuminates and other albumin derivatives' => 'Albumīni (ieskaitot divu vai vairāku sūkalu proteīnu koncentrātus, kas sausnā satur vairāk par 80 % no kopējās masas sūkalu proteīnus), albumināti un citi albumīna atvasinājumi',
    'Gelatin (including gelatin in rectangular (including square) sheets, whether or not surface-worked or coloured) and gelatin derivatives; isinglass; other glues of animal origin, excluding casein glues of heading 3501' => 'Želatīns (ieskaitot želatīnu taisnstūrveida, arī kvadrātveida, plāksnēs, ar apstrādātu vai neapstrādātu virsmu, iekrāsots vai nekrāsots) un želatīna atvasinājumi; zivju līme; citādas dzīvnieku izcelsmes līmes, izņemot kazeīna līmes, kas minētas pozīcijā 3501',
    'Peptones and their derivatives; other protein substances and their derivatives, not elsewhere specified or included; hide powder, whether or not chromed' => 'Peptoni un to atvasinājumi; citādas olbaltumvielas un to atvasinājumi, kas citur nav minēti vai iekļauti; hromētās vai nehromētās ādas pulveris',
    'Dextrins and other modified starches (for example, pregelatinised or esterified starches); glues based on starches, or on dextrins or other modified starches' => 'Dekstrīni un citas modificētās cietes (piemēram, želatinizētas vai esterificētas cietes); līmes uz cietes, dekstrīnu vai citādas modificētas cietes bāzes',
    'Prepared glues and other prepared adhesives, not elsewhere specified or included; products suitable for use as glues or adhesives, put up for retail sale as glues or adhesives, not exceeding a net weight of 1 kg' => 'Gatavas līmes un citādas gatavās līmvielas, kas citur nav minētas vai iekļautas; produkti, kas paredzēti izmantošanai kā līmes vai līmvielas, safasēti pārdošanai mazumtirdzniecībā kā līmes vai līmvielas, ar tīro masu līdz 1 kg',
    'Enzymes; prepared enzymes not elsewhere specified or included' => 'Fermenti; gatavi fermenti, kas citur nav minēti un iekļauti',
    'Safety fuses; detonating cords; percussion or detonating caps; igniters; electric detonators' => 'Degauklas; detonējošās auklas; triecienkapseles vai detonatora kapseles; degļi; elektrodetonatori',
