    'Ferro-cerium and other pyrophoric alloys in all forms; articles of combustible materials as specified in note 2 to this chapter' => 'Ferocērijs un visu veidu citādi pirofori sakausējumi; degošu materiālu izstrādājumi, kas minēti šīs nodaļas 2. piezīmē',
    'Photographic plates and film in the flat, sensitised, unexposed, of any material other than paper, paperboard or textiles; instant print film in the flat, sensitised, unexposed, whether or not in packs' => 'Neeksponētas gaismjutīgas plakanās fotoplates un fotofilmas no jebkuriem materiāliem, izņemot papīru, kartonu vai tekstilmateriālu; neeksponētās gaismjutīgas plakanās filmas momentfotogrāfijai, iepakotas vai neiepakotas',
    'Photographic film in rolls, sensitised, unexposed, of any material other than paper, paperboard or textiles; instant print film in rolls, sensitised, unexposed' => 'Gaismjutīgas neeksponētas fotofilmas ruļļos, no jebkura materiāla, izņemot papīru, kartonu un tekstilmateriālu; gaismjutīgas neeksponētas filmas momentfotogrāfijai, ruļļos',
