    'Anti-knock preparations, oxidation inhibitors, gum inhibitors, viscosity improvers, anti-corrosive preparations and other prepared additives, for mineral oils (including gasoline) or for other liquids used for the same purposes as mineral oils' => 'Gatavi antidetonatori, oksidācijas inhibitori, pārsveķošanās inhibitori, biezinātāji, pretkorozijas līdzekļi un citādas gatavās piedevas minerāleļļām (ieskaitot benzīnu) vai citiem šķidrumiem, ko izmanto tādām pašām vajadzībām kā minerāleļļas',
    'Prepared rubber accelerators; compound plasticisers for rubber or plastics, not elsewhere specified or included; anti-oxidising preparations and other compound stabilisers for rubber or plastics' => 'Gatavi kaučuka vulkanizācijas paātrinātāji; kaučuka vai plastmasas plastificēšanas savienojumi, kas citur nav minēti un iekļauti; antioksidanti un citi kaučuka un plastmasas stabilizēšanas savienojumi',
    'Organic composite solvents and thinners, not elsewhere specified or included; prepared paint or varnish removers' => 'Jaukti organiskie šķīdinātāji un atšķaidītāji, kas citur nav minēti un iekļauti; gatavi sastāvi krāsu un laku noņemšanai',
