    'Other plates, sheets, film, foil and strip, of plastics, non-cellular and not reinforced, laminated, supported or similarly combined with other materials' => 'Citādas plastmasas plātnes, loksnes, plēves, folijas un lentes, bez porām, un kas nav stiegrotas, kārtainas, uz pamatnes vai tamlīdzīgi savienotas ar citiem materiāliem',
