    'Natural rubber, balata, gutta-percha, guayule, chicle and similar natural gums, in primary forms or in plates, sheets or strip' => 'Dabiskais kaučuks, balata, gutaperča, gvajule, čikle un tamlīdzīgi dabiskie sveķi pirmformā vai plātnēs, loksnēs vai lentēs',
