    'Compounded rubber, unvulcanised, in primary forms or in plates, sheets or strip' => 'Kombinētais nevulkanizētais kaučuks pirmformās vai plātnēs, loksnēs vai sloksnēs',
    'Other forms (for example, rods, tubes and profile shapes) and articles (for example, discs and rings), of unvulcanised rubber' => 'Citādas formas (piemēram, stieņi, caurules un fasonprofili) un izstrādājumi (piemēram, diski un gredzeni) no nevulkanizēta kaučuka',
