    'Inner tubes, of rubber' => 'Gumijas kameras',
    'Hygienic or pharmaceutical articles (including teats), of vulcanised rubber other than hard rubber, with or without fittings of hard rubber' => 'Higiēniskie vai farmaceitiskie izstrādājumi (ieskaitot knupīšus) no vulkanizēta kaučuka, izņemot cieto kaučuku, arī ar piederumiem no cietā kaučuka',
    'Articles of apparel and clothing accessories (including gloves, mittens and mitts), for all purposes, of vulcanised rubber other than hard rubber' => 'Apģērba gabali un apģērba piederumi (ieskaitot cimdus – pirkstaiņus un dūraiņus) no vulkanizēta kaučuka, izņemot cietā kaučuka izstrādājumus, dažādām vajadzībām',
    'Other articles of vulcanised rubber other than hard rubber' => 'Citādi vulkanizēta kaučuka izstrādājumi, izņemot cietā kaučuka izstrādājumus',
    'Raw hides and skins of bovine (including buffalo) or equine animals (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not dehaired or split' => 'Liellopu vai zirgu jēlādas (svaigas vai sālītas, kaltētas, sārmotas, piķelētas vai citādi konservētas, bet ne miecētas, pergamentētas vai tālāk apstrādātas), atmatotas vai neatmatotas un šķeltas vai nešķeltas',
