    'Tanned or crust hides and skins of bovine (including buffalo) or equine animals, without hair on, whether or not split, but not further prepared' => 'Miecētas vai miecētas un žāvētas liellopu (arī bifeļu) vai zirgu ādas bez apmatojuma, šķeltas vai nešķeltas, bet tālāk neapstrādātas',
    'Tanned or crust skins of sheep or lambs, without wool on, whether or not split, but not further prepared' => 'Miecētas vai miecētas un žāvētas aitu un jēru ādas bez vilnas, šķeltas vai nešķeltas, bet tālāk neapstrādātas',
    'Tanned or crust hides and skins of other animals, without wool or hair on, whether or not split, but not further prepared' => 'Miecētas vai miecētas un žāvētas citu dzīvnieku ādas bez apmatojuma, šķeltas vai nešķeltas, bet tālāk neapstrādātas',
