    'Leather further prepared after tanning or crusting, including parchment-dressed leather, of other animals, without wool or hair on, whether or not split, other than leather of heading 4114' => 'Pēc miecēšanas vai miecēšanas un izžāvēšanas tālāk apstrādāta citu dzīvnieku āda, ieskaitot pergamentētu ādu bez apmatojuma, šķelta vai nešķelta, izņemot ādu, kas iekļauta pozīcijā 4114',
    'Chamois (including combination chamois) leather; patent leather and patent laminated leather; metallised leather' => 'Zamšāda (ieskaitot kombinēto zamšādu); lakāda un lakādas imitācija; metalizēta āda',
