    'Stranded wire, cables, plaited bands and the like, of aluminium, not electrically insulated' => 'Alumīnija stiepļu vijumi, troses, pītas lentes un tamlīdzīgi izstrādājumi bez elektroizolācijas',
    'Table, kitchen or other household articles and parts thereof, of aluminium; pot scourers and scouring or polishing pads, gloves and the like, of aluminium; sanitary ware and parts thereof, of aluminium' => 'Galda piederumi, virtuves piederumi un citi mājsaimniecības priekšmeti un to daļas no alumīnija; alumīnija kasīkļi un skrāpji vai vīšķi, cimdi un tamlīdzīgi izstrādājumi saimniecības piederumu tīrīšanai un pulēšanai; sanitārtehnikas izstrādājumi un to daļas no alumīnija',
    'Other articles of aluminium' => 'Citādi alumīnija izstrādājumi',
