    'Handsaws; blades for saws of all kinds (including slitting, slotting or toothless saw blades)' => 'Rokas zāģi; visu veidu zāģu plātnes (ieskaitot plātnes garenzāģēšanai, rievu iezāģēšanai vai bezzobu zāģu plātnes)',
    'Files, rasps, pliers (including cutting pliers), pincers, tweezers, metal-cutting shears, pipe-cutters, bolt croppers, perforating punches and similar hand tools' => 'Vīles, adatvīles, skrāpjvīles, knaibles (ieskaitot asknaibles), plakanknaibles, pincetes, knaiblītes, metālgrieznes, cauruļu griešanas darbgaldi, skrūvju grieznes, caurumsitņi un tamlīdzīgi rokas darbarīki',
    'Hand-operated spanners and wrenches (including torque meter wrenches but not including tap wrenches); interchangeable spanner sockets, with or without handles' => 'Rokas atslēgas (ieskaitot dinamometriskās atslēgas, bet izņemot grieztaviņas); atslēgu maiņgalviņas, ar rokturiem vai bez tiem',
    'Hand tools (including glaziers\' diamonds), not elsewhere specified or included; blowlamps; vices, clamps and the like, other than accessories for and parts of machine-tools or water-jet cutting machines; anvils; portable forges; hand- or pedal-operated grinding wheels with frameworks' => 'Rokas darbarīki (ieskaitot dimanta stiklgriežus), kas citur nav minēti vai iekļauti; lodlampas; skrūvspīles, spīles un tamlīdzīgi izstrādājumi, izņemot darbmašīnu vai ūdens strūklas griešanas mašīnu piederumus un daļas; laktas; pārnēsājamās ēzes; slīpripas ar rāmi un ar rokas vai kājas piedziņu',
    'Interchangeable tools for hand tools, whether or not power-operated, or for machine tools (for example, for pressing, stamping, punching, tapping, threading, drilling, boring, broaching, milling, turning or screw driving), including dies for drawing or extruding metal, and rock-drilling or earth-boring tools' => 'Maināmie instrumenti (ar mehānisku piedziņu vai bez tās) rokas darbarīkiem vai darbmašīnām (piemēram, presēšanai, štancēšanai, caurumošanai, vītņgriešanai, vītņurbšanai, urbšanai, izvirpošanai, caurvilkšanai, frēzēšanai, virpošanai vai skrūvju ieskrūvēšanai), ieskaitot presformas metālu vilkšanai vai presēšanai, un instrumenti klinšu vai grunts urbšanai',
    'Knives and cutting blades, for machines or for mechanical appliances' => 'Naži un asmeņi mašīnām vai mehāniskām ierīcēm',
