    'Knives with cutting blades, serrated or not (including pruning knives), other than knives of heading 8208, and blades therefor' => 'Naži ar zāģveida vai citādiem griezējasmeņiem (arī koku potējamie naži), izņemot nažus, kas minēti pozīcijā 8208, un to asmeņi',
    'Razors and razor blades (including razor blade blanks in strips)' => 'Bārdas naži un asmenīši (ieskaitot asmenīšu sagataves)',
    'Other articles of cutlery (for example, hair clippers, butchers\' or kitchen cleavers, choppers and mincing knives, paperknives); manicure or pedicure sets and instruments (including nail files)' => 'Citādi griezējizstrādājumi (piemēram, matu griešanas mašīnas, lieli miesnieku naži vai virtuves naži gaļas griešanai, kapājamie naži, papīrnaži); manikīra un pedikīra komplekti un instrumenti (ieskaitot nagu vīles)',
    'Spoons, forks, ladles, skimmers, cake-servers, fish-knives, butter-knives, sugar tongs and similar kitchen or tableware' => 'Karotes, dakšiņas, pavārnīcas, putu karotes, toršu lāpstiņas, zivju naži, sviesta naži, cukura standziņas un tamlīdzīgi virtuves un galda piederumi',
    'Padlocks and locks (key, combination or electrically operated), of base metal; clasps and frames with clasps, incorporating locks, of base metal; keys for any of the foregoing articles, of base metal' => 'Slēdzenes, piekaramās un iekaļamās (kas slēdzamas ar atslēgu vai koda kombināciju, elektriskas vai neelektriskas) no parastā metāla; parastā metāla skavas un ietvari ar skavām, kurās iestrādātas slēdzenes; atslēgas minētajiem izstrādājumiem no parastā metāla',
