    'Armoured or reinforced safes, strongboxes and doors and safe deposit lockers for strong-rooms, cash or deed boxes and the like, of base metal' => 'Bruņotas vai stiprinātas parastā metāla glabātavas, seifi un durvis, ieskaitot banku noliktavu durvis un seifus, naudas skapjus un kastes, un tamlīdzīgi parastā metāla izstrādājumi',
    'Fittings for loose-leaf binders or files, letter clips, letter corners, paper clips, indexing tags and similar office articles, of base metal; staples in strips (for example, for offices, upholstery, packaging), of base metal' => 'Pierīces ātršuvējiem vai dokumentu mapēm, kancelejas spailes un saspraudes, spraudes, indeksatori un tamlīdzīgi kancelejas piederumi no parastā metāla; šuvēju stiepļu skavas blokos (piemēram, kancelejas vajadzībām, mēbeļu tapsēšanai, saiņošanai) no parastā metāla',
    'Bells, gongs and the like, non-electric, of base metal; statuettes and other ornaments, of base metal; photograph, picture or similar frames, of base metal; mirrors of base metal' => 'Parastā metāla zvani, gongi un tamlīdzīgi neelektriski izstrādājumi; parastā metāla statuetes un citi dekoratīvi izstrādājumi; parastā metāla ietvari fotogrāfijām, gleznām un tamlīdzīgi ietvari; parastā metāla spoguļi',
    'Flexible tubing of base metal, with or without fittings' => 'Lokanas parastā metāla caurules ar savienotājelementiem vai bez tiem',
