    'Stoppers, caps and lids (including crown corks, screw caps and pouring stoppers), capsules for bottles, threaded bungs, bung covers, seals and other packing accessories, of base metal' => 'Aizbāžņi, vāciņi (ieskaitot pudeļu vāciņus, uzgriežamos vāciņus un aizbāžņus), pudeļu vāciņi, aizbāžņu apvalki, vītņoti noslēgi, plombas un citi iepakošanas piederumi no parastā metāla',
    'Wire, rods, tubes, plates, electrodes and similar products, of base metal or of metal carbides, coated or cored with flux material, of a kind used for soldering, brazing, welding or deposition of metal or of metal carbides; wire and rods, of agglomerated base metal powder, used for metal spraying' => 'Stieples, stieņi, caurules, plāksnes, elektrodi un tamlīdzīgi izstrādājumi no parastā metāla vai no metāla karbīdiem, ar pārklājumu vai serdi no kušņu materiāla, izmantojami lodēšanai ar mīkstlodi, cietlodi, metināšanai vai metāla un metāla karbīdu uzklāšanai; parastā metāla aglomerēta pulvera stieples, kuras izmanto metalizēšanā izsmidzinot',
    'Nuclear reactors; fuel elements (cartridges), non-irradiated, for nuclear reactors; machinery and apparatus for isotopic separation' => 'Kodolreaktori; neapstaroti degvielas elementi (kasetes) kodolreaktoriem; iekārtas un aparāti izotopu separācijai',
    'Steam or other vapour generating boilers (other than central heating hot water boilers capable also of producing low pressure steam); superheated water boilers' => 'Ūdens tvaika vai citādi tvaika katli (izņemot centrālapkures karstā ūdens katlus, kas spēj ražot arī zemspiediena tvaiku); ūdens pārkarsēšanas katli',
