    'Producer gas or water gas generators, with or without their purifiers; acetylene gas generators and similar water process gas generators, with or without their purifiers' => 'gāzģeneratori vai ūdens gāzģeneratori ar attīrīšanas ierīcēm vai bez tām; acetilēna gāzģeneratori un tamlīdzīgi ūdens pārstrādes gāzģeneratori ar attīrīšanas ierīcēm vai bez tām',
    'Steam turbines and other vapour turbines' => 'Ūdens tvaika un citādas tvaika turbīnas',
