    'Air or vacuum pumps, air or other gas compressors and fans; ventilating or recycling hoods incorporating a fan, whether or not fitted with filters; gas-tight biological safety cabinets, whether or not fitted with filters' => 'Gaisa vai vakuumsūkņi, gaisa vai citas gāzes kompresori un ventilatori; ventilācijas vai velkmes skapji ar ventilatoru, aprīkoti ar filtru vai bez tā; gāznecaurlaidīgi bioloģiski drošuma skapji, aprīkoti ar filtru vai bez tā',
    'Air-conditioning machines, comprising a motor-driven fan and elements for changing the temperature and humidity, including those machines in which the humidity cannot be separately regulated' => 'Gaisa kondicionēšanas iekārtas, kam ir ventilators ar motoru un ierīces gaisa mitruma un temperatūras mainīšanai, ieskaitot aparātus, kuros mitrumu atsevišķi neregulē',
    'Furnace burners for liquid fuel, for pulverised solid fuel or for gas; mechanical stokers, including their mechanical grates, mechanical ash dischargers and similar appliances' => 'Kurtuvju sprauslas šķidrai degvielai, degļi cietai putekļveida degvielai un gāzes degļi; mehāniskās un automātiskās kurtuves, mehāniski režģi, ārdi, ierīces pelnu aizvākšanai un citas tamlīdzīgas ierīces',
    'Industrial or laboratory furnaces and ovens, including incinerators, non-electric' => 'Neelektriskas rūpnīcu vai laboratoriju kurtuves un krāsnis, ieskaitot neelektriskas atkritumu sadedzināšanas krāsnis',
    'Refrigerators, freezers and other refrigerating or freezing equipment, electric or other; heat pumps other than air-conditioning machines of heading 8415' => 'Ledusskapji, saldētavas un citas dzesēšanas vai saldēšanas iekārtas, elektriskas vai cita veida; siltumsūkņi, izņemot gaisa kondicionēšanas iekārtas pozīcijā 8415',
    'Machinery, plant or laboratory equipment, whether or not electrically heated (excluding furnaces, ovens and other equipment of heading 8514), for the treatment of materials by a process involving a change of temperature such as heating, cooking, roasting, distilling, rectifying, sterilising, pasteurising, steaming, drying, evaporating, vaporising, condensing or cooling, other than machinery or plant of a kind used for domestic purposes; instantaneous or storage water heaters, non-electric' => 'Rūpnīcu vai laboratoriju iekārtas ar elektrisku vai neelektrisku karsēšanu (izņemot kurtuves, krāsnis un citas iekārtas, kas iekļautas pozīcijā 8514) materiālu termiskai apstrādei (karsēšanai, vārīšanai, apdedzināšanai vai kausēšanai, destilācijai, rektifikācijai, sterilizācijai, pasterizācijai, žāvēšanai, tvaicēšanai, kondensācijai vai atdzesēšanai), izņemot mājsaimniecības vajadzībām izmantojamās; neelektriskie caurplūdes vai termoakumulācijas ūdenssildītāji',
    'Calendering or other rolling machines, other than for metals or glass, and cylinders therefor' => 'Kalandri vai citādas velmju (ruļļu) mašīnas, izņemot mašīnas metālam vai stiklam, un to cilindri',
    'Centrifuges, including centrifugal dryers; filtering or purifying machinery and apparatus, for liquids or gases' => 'Centrifūgas, arī centrbēdzes žāvētavas; šķidrumu vai gāzu filtrēšanas vai attīrīšanas ierīces un aparāti',
    'Dishwashing machines; machinery for cleaning or drying bottles or other containers; machinery for filling, closing, sealing or labelling bottles, cans, boxes, bags or other containers; machinery for capsuling bottles, jars, tubes and similar containers; other packing or wrapping machinery (including heat-shrink wrapping machinery); machinery for aerating beverages' => 'Trauku mazgājamās mašīnas; iekārtas pudeļu vai citu trauku mazgāšanai vai žāvēšanai; iekārtas pudeļu, kannu, kārbu, maisiņu vai citu tilpņu pildīšanai, aizvākošanai, noslēgšanai, kapsulēšanai vai marķēšanai; iekārtas pudeļu, burku, tūbiņu un tamlīdzīgas taras aizkapsulēšanai; citādas iekārtas iepakošanai vai iesaiņošanai (ieskaitot karstās vakuuma iesaiņošanas iekārtas); iekārtas dzērienu gāzēšanai',
    'Weighing machinery (excluding balances of a sensitivity of 5 cg or better), including weight-operated counting or checking machines; weighing machine weights of all kinds' => 'Iekārtas svēršanai (izņemot svarus ar 0,05 g un lielāku precizitāti), arī svari, kas apgādāti ar ierīcēm masas kontrolei vai aprēķināšanai; jebkura veida svaru atsvari',
    'Mechanical appliances (whether or not hand-operated) for projecting, dispersing or spraying liquids or powders; fire extinguishers, whether or not charged; spray guns and similar appliances; steam or sandblasting machines and similar jet projecting machines' => 'Mehāniskas ierīces (ar roku darbināmas vai citādas) šķidrumu vai pulverveida vielu izsmidzināšanai vai izkliedēšanai; ugunsdzēšamie aparāti, uzpildīti vai neuzpildīti; pulverizatori un tamlīdzīgas ierīces; smilšu strūklas vai tvaikstrūklas mašīnas un tamlīdzīgi smidzināšanas aparāti',
    'Pulley tackle and hoists other than skip hoists; winches and capstans; jacks' => 'Celšanas trīši un cēlāji, izņemot liftcēlājus; vinčas un kabestāni; domkrati',
    'Ships\' derricks; cranes, including cable cranes; mobile lifting frames, straddle carriers and works trucks fitted with a crane' => 'Derikceltņi; celtņi, ieskaitot trošuceltņus; pārvietojama pacēlājkāpnes, portāliekrāvēji un mehānismi aprīkoti ar celtni',
    'Fork-lift trucks; other works trucks fitted with lifting or handling equipment' => 'Autokrāvēji ar dakšu; citi kravas transportētāji ar celšanas vai takelāžas ierīcēm',
    'Other lifting, handling, loading or unloading machinery (for example, lifts, escalators, conveyors, teleferics)' => 'Citas mašīnas celšanai, pārvietošanai, iekraušanai vai izkraušanai (piemēram, lifti, eskalatori, konveijeri, telferi)',
    'Self-propelled bulldozers, angledozers, graders, levellers, scrapers, mechanical shovels, excavators, shovel loaders, tamping machines and roadrollers' => 'Pašgājēji buldozeri ar maināmu vērstuvi, autogreideri, planētāji, skrēperi, mehāniskās lāpstas, ekskavatori, vienkausa krāvēji, blietēšanas mašīnas un ceļa veltņi',
    'Other moving, grading, levelling, scraping, excavating, tamping, compacting, extracting or boring machinery, for earth, minerals or ores; piledrivers and pile extractors; snowploughs and snowblowers' => 'Citas mašīnas grunts, minerālu vai rūdu pārvietošanai, planēšanai, profilēšanai, rakšanai, izstrādāšanai, blietēšanai, blīvēšanai, izņemšanai vai urbšanai; iekārtas pāļu dzīšanai un iekārtas pāļu izvilkšanai; sniega arkli un sniega rotortīrītāji',
    'Parts suitable for use solely or principally with the machinery of headings 8425 to 8430' => 'Daļas, kas paredzētas vienīgi vai galvenokārt pozīciju 8425 līdz 8430 mehānismiem',
    'Agricultural, horticultural or forestry machinery for soil preparation or cultivation; lawn or sports-ground rollers' => 'Lauksaimniecības, dārzkopības vai mežsaimniecības tehnika augsnes sagatavošanai vai apstrādei; mauriņu vai sporta laukumu veltņi',
    'Harvesting or threshing machinery, including straw or fodder balers; grass or hay mowers; machines for cleaning, sorting or grading eggs, fruit or other agricultural produce, other than machinery of heading 8437' => 'Mašīnas lauksaimniecības kultūru novākšanai vai kulšanai, ieskaitot salmu vai lopbarības preses; zāles vai siena pļaujmašīnas; mašīnas olu, augļu vai citu lauksaimniecības produktu tīrīšanai, šķirošanai vai brāķēšanai, izņemot mašīnas, kas ietvertas pozīcijā 8437',
    'Milking machines and dairy machinery' => 'Slaukšanas aparāti un piena pārstrādes iekārtas',
    'Presses, crushers and similar machinery used in the manufacture of wine, cider, fruit juices or similar beverages' => 'Preses, smalcinātāji un tamlīdzīgas mašīnas vīna, sidra, augļu sulu un tamlīdzīgu dzērienu ražošanai',
    'Other agricultural, horticultural, forestry, poultry-keeping or bee-keeping machinery, including germination plant fitted with mechanical or thermal equipment; poultry incubators and brooders' => 'Citādas mašīnas lauksaimniecībai, dārzkopībai, mežkopībai, putnkopībai vai biškopībai, ieskaitot iekārtas sēklu diedzēšanai (ar mehāniskām ierīcēm vai sildierīcēm); mājputnu inkubatori un brūderi',
    'Machines for cleaning, sorting or grading seed, grain or dried leguminous vegetables; machinery used in the milling industry or for the working of cereals or dried leguminous vegetables, other than farm-type machinery' => 'Mašīnas sēklu, graudu vai kaltētu pākšu dārzeņu tīrīšanai, šķirošanai vai sijāšanai; mašīnas, ko izmanto miltrūpniecībā vai labības un kaltētu pākšu dārzeņu apstrādei, izņemot mašīnas lauku saimniecībām',
    'Machinery, not specified or included elsewhere in this chapter, for the industrial preparation or manufacture of food or drink, other than machinery for the extraction or preparation of animal or fixed vegetable or microbial fats or oils' => 'Citādas iekārtas pārtikas rūpniecībai, dzērieniem, kas citur šajā nodaļā nav minētas, izņemot iekārtas dzīvnieku, negaistošo augu vai mikrobu tauku vai eļļu ekstrakcijai vai apstrādei',
    'Machinery for making pulp of fibrous cellulosic material or for making or finishing paper or paperboard' => 'Iekārtas papīra masas ražošanai no celulozes šķiedrmateriāliem vai papīra vai kartona ražošanai vai apdarei',
    'Bookbinding machinery, including book-sewing machines' => 'Iekārtas grāmatu iesiešanai, ieskaitot brošēšanas mašīnas',
    'Other machinery for making up paper pulp, paper or paperboard, including cutting machines of all kinds' => 'Citas iekārtas papīra masas, papīra vai kartona izstrādājumu ražošanai, ieskaitot visdažādākās mašīnas papīra vai kartona griešanai',
    'Machinery, apparatus and equipment (other than the machines of headings 8456 to 8465) for preparing or making plates, cylinders or other printing components; plates, cylinders and other printing components; plates, cylinders and lithographic stones, prepared for printing purposes (for example, planed, grained or polished)' => 'Iekārtas, aparatūra un aprīkojums (izņemot pozīcijās 8456 līdz 8465 minētās mašīnas) plašu, cilindru vai citu tipogrāfijas elementu sagatavošanai vai izgatavošanai; plates, cilindri un citādi tipogrāfijas elementi; plates, cilindri un litogrāfijas akmeņi, kas sagatavoti iespiešanai (piemēram, apvirpoti, slīpēti vai pulēti)',
    'Printing machinery used for printing by means of plates, cylinders and other printing components of heading 8442; other printers, copying machines and facsimile machines, whether or not combined; parts and accessories thereof' => 'Iespiedmašīnas, izmantojot plates, cilindrus un citus tipogrāfijas komponentus, kas minēti pozīcijā 8442; citādi printeri, kopēšanas mašīnas un faksa aparāti, komplektā vai atsevišķi; to daļas un piederumi',
    'Machines for extruding, drawing, texturing or cutting man-made textile materials' => 'Mašīnas mākslīgo tekstilmateriālu ekstrudēšanai, stiepšanai, teksturēšanai vai griešanai',
    'Machines for preparing textile fibres; spinning, doubling or twisting machines and other machinery for producing textile yarns; textile reeling or winding (including weft-winding) machines and machines for preparing textile yarns for use on the machines of heading 8446 or 8447' => 'Mašīnas tekstilšķiedru sagatavošanai; vērpšanas, kārtošanas vai šķeterēšanas mašīnas un citādas iekārtas tekstildziju ražošanai; tīšanas un spolēšanas (ieskaitot audu spolēšanas) mašīnas un mašīnas, kas sagatavo tekstilpavedienus izmantošanai pozīcijas 8446 vai 8447 mašīnās',
    'Weaving machines (looms)' => 'Aušanas mašīnas (stelles)',
    'Knitting machines, stitch-bonding machines and machines for making gimped yarn, tulle, lace, embroidery, trimmings, braid or net and machines for tufting' => 'Adāmmašīnas, ķetelēšanas mašīnas, mašīnas fasondzijas, pozamenta pavediena, tilla, mežģīņu, izšuvumu iegūšanai, lenšu izgatavošanai, tīklu siešanai, malu apstrādāšanai un stepēšanai',
    'Auxiliary machinery for use with machines of heading 8444, 8445, 8446 or 8447 (for example, dobbies, jacquards, automatic stop motions, shuttle changing mechanisms); parts and accessories suitable for use solely or principally with the machines of this heading or of heading 8444, 8445, 8446 or 8447 (for example, spindles and spindle flyers, card clothing, combs, extruding nipples, shuttles, healds and heald-frames, hosiery needles)' => 'Palīgierīces izmantošanai pozīcijā 8444, 8445, 8446 vai 8447 minētajās mašīnās (piemēram nīšu pacēlāji, žakardmašīnas, automātiskās kustības aptures, atspoļu maiņas mehānismi); daļas un piederumi izmantošanai vienīgi vai galvenokārt šajā pozīcijā vai pozīcijā 8444, 8445, 8446 vai 8447 minētajās mašīnās (piemēram vārpstiņas un vārpstiņu spārniņi, adatu garnitūras, ķemmes, izvilkšanas sprauslas, atspoles, nīšstāvi un nīšstāvu rāmji, trikotāžas adatas)',
    'Household or laundry-type washing machines, including machines which both wash and dry' => 'Veļas mazgājamās mašīnas mājsaimniecībai vai veļas mazgātavām, ieskaitot mašīnas ar sausināšanas ierīcēm',
    'Machinery (other than machines of heading 8450) for washing, cleaning, wringing, drying, ironing, pressing (including fusing presses), bleaching, dyeing, dressing, finishing, coating or impregnating textile yarns, fabrics or made-up textile articles and machines for applying the paste to the base fabric or other support used in the manufacture of floor coverings such as linoleum; machines for reeling, unreeling, folding, cutting or pinking textile fabrics' => 'Iekārtas (izņemot pozīcijā 8450 minētās mašīnas) tekstildzijas, audumu un gatavo tekstilizstrādājumu mazgāšanai, tīrīšanai, žāvēšanai, gludināšanai, presēšanai (ieskaitot sakausēšanas preses), balināšanai, krāsošanai, apretēšanai, apdarināšanai, piesūcināšanai vai impregnēšanai un mašīnas, ko izmanto linoleju vai tamlīdzīgu grīdas segumu ražošanā pastas uzklāšanai uz pamatdrānas vai citādas pamatnes; mašīnas audumu satīšanai, attīšanai, locīšanai, griešanai un robošanai',
    'Sewing machines, other than book-sewing machines of heading 8440; furniture, bases and covers specially designed for sewing machines; sewing machine needles' => 'Šujmašīnas, izņemot pozīcijas 8440 brošēšanas mašīnas; skapīši, pamatnes un pārsegi, kas īpaši paredzēti šujmašīnām; šujmašīnu adatas',
    'Machinery for preparing, tanning or working hides, skins or leather or for making or repairing footwear or other articles of hides, skins or leather, other than sewing machines' => 'Iekārtas jēlādu, kailādu un ādas pirmapstrādei, miecēšanai un apstrādei, ādas apavu un citu ādas izstrādājumu izgatavošanai vai labošanai, izņemot šujmašīnas',
    'Converters, ladles, ingot moulds and casting machines, of a kind used in metallurgy or in metal foundries' => 'Konverteri, liešanas kausi, lietņu veidnes un liešanas mašīnas, kuras izmanto metalurģijā vai metālliešanā',
    'Metal-rolling mills and rolls therefor' => 'Velmēšanas stāvi un to velmji',
    'Machine tools for working any material by removal of material, by laser or other light or photon beam, ultrasonic, electrodischarge, electrochemical, electron beam, ionic-beam or plasma arc processes; water-jet cutting machines' => 'Darbmašīnas jebkādu materiālu apstrādei ar materiālu noņemšanu, pielietojot lāzera vai citu gaismas vai kvantu starojumu, ar ultraskaņu, elektriskā loka izlādi, elektroķīmiskus procesus, elektronu starojumu, jonizējošo starojumu vai apstrādi plazmas lokā; ūdens strūklas griešanas mašīnas',
    'Machining centres, unit construction machines (single station) and multi-station transfer machines, for working metal' => 'Daudzfunkcionālas darbmašīnas, vienpozīcijas un daudzpozīciju agregātu darbmašīnas metāla apstrādei',
    'Lathes (including turning centres) for removing metal' => 'Metālgriešanas virpas (ieskaitot daudzfunkcionālas virpas)',
    'Machine tools (including way-type unit head machines) for drilling, boring, milling, threading or tapping by removing metal, other than lathes (including turning centres) of heading 8458' => 'Metālgriešanas darbmašīnas (arī lineārās agregātu darbmašīnas), urbšanas, virpošanas, frēzēšanas, vītņgriešanas un vītņurbšanas darbmašīnas, izņemot pozīcijā 8458 minētās virpas (ieskaitot daudzfunkcionālās virpas)',
    'Machine tools for deburring, sharpening, grinding, honing, lapping, polishing or otherwise finishing metal or cermets by means of grinding stones, abrasives or polishing products, other than gear cutting, gear grinding or gear finishing machines of heading 8461' => 'Atskarpju noņemšanas, asināšanas, slīpēšanas, honēšanas, pieslīpēšanas, pulēšanas un tamlīdzīgu tīrapstrādes operāciju veikšanas darbmašīnas metālu vai metālkeramikas apdarei, lietojot slīpakmeņus, abrazīvus un pulēšanas līdzekļus, izņemot pozīcijā 8461 minētos zobu iegriešanas, zobu asināšanas vai zobu apdares darbmašīnas',
    'Machine tools for planing, shaping, slotting, broaching, gear cutting, gear grinding or gear finishing, sawing, cutting-off and other machine tools working by removing metal or cermets, not elsewhere specified or included' => 'Garenēvelmašīnas, šķērsēvelmašīnas, vertikālās ēvelmašīnas; caurvilkšanas un zobu iegriešanas darbmašīnas, zobu slīpmašīnas, zobu apdares mašīnas, apgriešanas, zāģēšanas un citādas darbmašīnas metāla un metālkeramikas apstrādei, kas citur nav minētas vai iekļautas',
    'Machine tools (including presses) for working metal by forging, hammering or die forging (excluding rolling mills); machine tools (including presses, slitting lines and cut-to-length lines) for working metal by bending, folding, straightening, flattening, shearing, punching, notching or nibbling (excluding draw-benches); presses for working metal or metal carbides, not specified above' => 'Darbmašīnas (ieskaitot preses) metālu kalšanai, presēšanai vai veidkalšanai (izņemot velmēšanas stāvus); darbmašīnas (ieskaitot preses, griešanas līnijas un gareniskas griešanas līnijas) metālu liekšanai, locīšanai, taisnošanai, līdzināšanai, lokšņu griešanai, caurumošanai, izciršanai vai smalcināšanai (izņemot vilkšanas darbgaldus); iepriekš neminētas preses metāla vai metāla karbīdu apstrādei',
    'Other machine tools for working metal or cermets, without removing material' => 'Citādas darbmašīnas metāla vai metālkeramikas apstrādei bez materiāla absorbcijas',
    'Machine tools for working stone, ceramics, concrete, asbestos-cement or like mineral materials or for cold working glass' => 'Darbmašīnas akmeņu, keramikas, betona, azbestcementa un tamlīdzīgu minerālu materiālu apstrādei vai stikla aukstai apstrādei',
    'Machine tools (including machines for nailing, stapling, glueing or otherwise assembling) for working wood, cork, bone, hard rubber, hard plastics or similar hard materials' => 'Darbmašīnas koka, korķa, kaula, cietā kaučuka, cietu plastmasu un tamlīdzīgu cietu materiālu apstrādei (ieskaitot darbmašīnas naglošanai, skavošanai, līmēšanai un citādai montāžai)',
    'Parts and accessories suitable for use solely or principally with the machines of headings 8456 to 8465, including work or tool holders, self-opening dieheads, dividing heads and other special attachments for the machines; tool holders for any type of tool for working in the hand' => 'Daļas un piederumi, kas paredzēti tikai vai galvenokārt pozīcijās 8456–8465 minētajām iekārtām, ieskaitot ierīces instrumentu un detaļu nostiprināšanai, pašatveres vītņgalvas, dalītājgalvas un citādu speciālo aprīkojumu mašīnām; instrumentu nostiprināšanas ierīces visu veidu rokas instrumentiem',
    'Tools for working in the hand, pneumatic, hydraulic or with self-contained electric or non-electric motor' => 'Rokas instrumenti, pneimatiski, hidrauliski vai ar iebūvētu elektrisku vai neelektrisku motoru',
    'Machinery and apparatus for soldering, brazing or welding, whether or not capable of cutting, other than those of heading 8515; gas-operated surface tempering machines and appliances' => 'Iekārtas un aparāti lodēšanai ar mīkstlodi un cietlodi vai metināšanai, derīgi vai nederīgi griešanai, izņemot pozīcijā 8515 minētos; ar gāzi darbināmas iekārtas un aparāti virsmas termiskai apstrādei',
    'Calculating machines and pocket-size data-recording, reproducing and displaying machines with calculating functions; accounting machines, postage-franking machines, ticket-issuing machines and similar machines, incorporating a calculating device; cash registers' => 'Kalkulatori un kabatas formāta ierīces ar skaitļošanas funkcijām datu ierakstīšanai, reproducēšanai un demonstrēšanai; skaitļošanas mašīnas, ierīces pasta sūtījumu frankēšanai, biļešu izsniegšanas mašīnas un citas līdzīgas ierīces, kurās iestrādātas skaitļošanas ierīces; kases aparāti',
    'Automatic data-processing machines and units thereof; magnetic or optical readers, machines for transcribing data onto data media in coded form and machines for processing such data, not elsewhere specified or included' => 'Automātiskās datu apstrādes iekārtas un to bloki; magnētiskie vai optiskie lasītāji, iekārtas datu ierakstīšanai kodētā veidā datu vidē un iekārtas šādu datu apstrādei, kas nav norādītas vai iekļautas citur',
    'Other office machines (for example, hectograph or stencil duplicating machines, addressing machines, automatic banknote dispensers, coin-sorting machines, coin-counting or -wrapping machines, pencil-sharpening machines, perforating or stapling machines)' => 'Citādas biroja iekārtas (piemēram, hektogrāfu un trafaretu pavairošanas mašīnas, adrešu mašīnas, banknošu izsniegšanas automāti, monētu šķirošanas, skaitīšanas un iesaiņošanas mašīnas, zīmuļu asināmās mašīnas, perforācijas mašīnas un skavošanas mašīnas)',
    'Parts and accessories (other than covers, carrying cases and the like) suitable for use solely or principally with machines of headings 8470 to 8472' => 'Daļas un piederumi (izņemot pārsegus, futrāļus, un tamlīdzīgus), kas paredzēti tikai vai galvenokārt pozīcijās 8470–8472 minētajām mašīnām',
    'Machinery for sorting, screening, separating, washing, crushing, grinding, mixing or kneading earth, stone, ores or other mineral substances, in solid (including powder or paste) form; machinery for agglomerating, shaping or moulding solid mineral fuels, ceramic paste, unhardened cements, plastering materials or other mineral products in powder or paste form; machines for forming foundry moulds of sand' => 'Iekārtas grunts, akmeņu, rūdu un citu cieta agregātstāvokļa minerālvielu (arī pulvera un pastas veidā) šķirošanai, sijāšanai, atdalīšanai, skalošanai, drupināšanai, slīpēšanai, jaukšanai vai mīcīšanai; iekārtas cieta minerālā kurināmā, keramiskās masas, necietināta cementa, apmešanas materiālu un citu pulverveida vai pastas veida minerālproduktu aglomerācijai, veidošanai vai formēšanai; iekārtas liešanas veidņu formēšanai no smiltīm',
    'Machines for assembling electric or electronic lamps, tubes or valves or flashbulbs, in glass envelopes; machines for manufacturing or hot working glass or glassware' => 'Mašīnas elektrisko spuldžu, elektronisko, elektronstaru un gāzizlādes lampu montēšanai stikla kolbās; mašīnas stikla vai tā izstrādājumu izgatavošanai vai karstai apstrādei',
    'Automatic goods-vending machines (for example, postage stamp, cigarette, food or beverage machines), including money-changing machines' => 'Tirdzniecības automāti (piemēram, pastmarku, cigarešu, pārtikas preču vai dzērienu pārdošanai), ieskaitot naudas maiņas automātus',
    'Machinery for working rubber or plastics or for the manufacture of products from these materials, not specified or included elsewhere in this chapter' => 'Iekārtas gumijas vai plastmasas apstrādei vai šo materiālu izstrādājumu ražošanai, kas citur šajā nodaļā nav minētas',
    'Machinery for preparing or making up tobacco, not specified or included elsewhere in this chapter' => 'Tabakas pārstrādes un tabakas maisījumu gatavošanas iekārtas, kas citur šajā nodaļā nav minētas',
    'Machines and mechanical appliances having individual functions, not specified or included elsewhere in this chapter' => 'Speciāli mehānismi un mehāniskas ierīces, kas citur šajā nodaļā nav minētas',
    'Moulding boxes for metal foundry; mould bases; moulding patterns; moulds for metal (other than ingot moulds), metal carbides, glass, mineral materials, rubber or plastics' => 'Metālliešanas veidkastes; kokiļu plātnes; liešanas veiduļi; veidnes metālam (izņemot lietņu veidnes), metālu karbīdiem, stiklam, neorganiskiem materiāliem, gumijai vai plastmasai',
    'Taps, cocks, valves and similar appliances for pipes, boiler shells, tanks, vats or the like, including pressure-reducing valves and thermostatically controlled valves' => 'Krāni, vārsti, ventiļi un citi piederumi cauruļvadiem, katlu korpusiem, rezervuāriem, cisternām, tvertnēm un tamlīdzīgām tilpnēm, ieskaitot redukcijas un termoregulācijas vārstus',
    'Ball or roller bearings' => 'Lodīšu vai rullīšu gultņi',
    'Transmission shafts (including cam shafts and crank shafts) and cranks; bearing housings and plain shaft bearings; gears and gearing; ball or roller screws; gear boxes and other speed changers, including torque converters; flywheels and pulleys, including pulley blocks; clutches and shaft couplings (including universal joints)' => 'Transmisijas vārpstas (ieskaitot sadales vārpstas un kloķvārpstas) un kloķi; gultņu korpusi un slīdgultņi; zobrati un zobpārvadi; lodīšu gaitas skrūves vai rullīšu skrūves; pārnesumkārbas un citādi ātruma regulatori, ieskaitot hidrotransformatorus; spararati un trīši, ieskaitot polispastus; sajūgi un vārpstu sakabes (ieskaitot kardāna savienojumus)',
    'Gaskets and similar joints of metal sheeting combined with other material or of two or more layers of metal; sets or assortments of gaskets and similar joints, dissimilar in composition, put up in pouches, envelopes or similar packings; mechanical seals' => 'Starplikas un salaidumi no metāla loksnēm savienojumā ar citu materiālu vai no divām un vairākām metāla kārtām; starpliku un tamlīdzīgu savienojumu komplekti un sortimenti ar atšķirīgu sastāvu, kas iesaiņoti maisiņos, aploksnēs vai citā līdzīgā iesaiņojumā; mehāniskie blīvslēgi',
    'Machines for additive manufacturing' => 'Aditīvās ražošanas iekārtas',
    'Machines and apparatus of a kind used solely or principally for the manufacture of semiconductor boules or wafers, semiconductor devices, electronic integrated circuits or flat panel displays; machines and apparatus specified in note 11(C) to this chapter; parts and accessories' => 'Tāda veida iekārtas un aparāti, kas tikai vai vienīgi izmantoti kristālu vai kristālos nesagrieztu pusvadītājplākšņu, pusvadītājierīču, elektronisko integrālo shēmu vai plakano ekrānu paneļu ražošanai, kā noteikts šīs nodaļas 11. C piezīmē; daļas un piederumi',
    'Machinery parts, not containing electrical connectors, insulators, coils, contacts or other electrical features, not specified or included elsewhere in this chapter' => 'Dažādu mašīnu un mehānismu daļas, kam nav elektrotehnisko kabeļuzmavu, izolatoru, spoļu, kontaktu vai citādu elektrotehnisko detaļu un kas citur šajā nodaļā nav minētas',
    'Electric motors and generators (excluding generating sets)' => 'Elektromotori un elektroģeneratori (izņemot ģeneratoriekārtas)',
    'Electric generating sets and rotary converters' => 'Elektroģeneratoru iekārtas un rotējošie pārveidotāji',
    'Parts suitable for use solely or principally with the machines of heading 8501 or 8502' => 'Detaļas, kas paredzētas tikai vai galvenokārt iekārtām, kas minētas pozīcijā 8501 vai 8502',
    'Electrical transformers, static converters (for example, rectifiers) and inductors' => 'Elektrības transformatori, statiskie pārveidotāji (piemēram, taisngrieži) un indukcijas spoles',
    'Electromagnets; permanent magnets and articles intended to become permanent magnets after magnetisation; electromagnetic or permanent magnet chucks, clamps and similar holding devices; electromagnetic couplings, clutches and brakes; electromagnetic lifting heads' => 'Elektromagnēti; pastāvīgie magnēti un izstrādājumi, kas paredzēti pārvēršanai pastāvīgajos magnētos pēc to magnetizēšanas; elektromagnētiskas patronas, spīles un tamlīdzīgas stiprinājuma ierīces vai šādas ierīces ar pastāvīgajiem magnētiem; elektromagnētiskās sakabes, sajūgi un bremzes; elektromagnētiskas celšanas ierīces',
    'Primary cells and primary batteries' => 'Galvaniskie elementi un galvaniskās baterijas',
