    'Lenses, prisms, mirrors and other optical elements, of any material, mounted, being parts of or fittings for instruments or apparatus, other than such elements of glass not optically worked' => 'Lēcas, prizmas, spoguļi un citi optiskie elementi no jebkura materiāla, iestiprināti, ja tie ir instrumentu vai ierīču daļas vai piederumi, izņemot tamlīdzīgus elementus no optiski neapstrādāta stikla',
    'Frames and mountings for spectacles, goggles or the like, and parts thereof' => 'Briļļu, aizsargbriļļu vai tamlīdzīgu izstrādājumu ietvari, stiprinājumi un to daļas',
    'Spectacles, goggles and the like, corrective, protective or other' => 'Brilles, aizsargbrilles un tamlīdzīgi koriģējoši, aizsargājoši vai citādi izstrādājumi',
    'Binoculars, monoculars, other optical telescopes, and mountings therefor; other astronomical instruments and mountings therefor, but not including instruments for radio-astronomy' => 'Binokļi, monokulāri, citādi optiskie teleskopi un to stiprinājumi; citas astronomijā izmantojamas ierīces un to stiprinājumi, izņemot ierīces, ko izmanto radioastronomijā',
    'Photographic (other than cinematographic) cameras; photographic flashlight apparatus and flashbulbs other than discharge lamps of heading 8539' => 'Fotoaparāti (izņemot kinokameras); zibspuldzes, izņemot pozīcijā 8539 minētās gāzizlādes spuldzes',
    'Cinematographic cameras and projectors, whether or not incorporating sound recording or reproducing apparatus' => 'Kinokameras un kinoprojektori ar skaņas ierakstīšanas vai atskaņošanas iekārtām vai bez tām',
    'Image projectors, other than cinematographic; photographic (other than cinematographic) enlargers and reducers' => 'Statisku attēlu projektori, izņemot kinoprojektorus; fotopalielinātāji un projicēšanas iekārtas attēla samazināšanai (izņemot kinematogrāfiskās)',
    'Apparatus and equipment for photographic (including cinematographic) laboratories, not specified or included elsewhere in this chapter; negatoscopes; projection screens' => 'Fotolaboratoriju un kinolaboratoriju iekārtas un aprīkojums, kas šajā nodaļā citur nav minētas; negatoskopi; projicēšanas ekrāni',
    'Compound optical microscopes, including those for photomicrography, cinephotomicrography or microprojection' => 'Kombinēti optiskie mikroskopi, ieskaitot mikroskopus mikrofotogrāfijai, mikrofilmēšanai vai mikroprojicēšanai',
    'Microscopes other than optical microscopes; diffraction apparatus' => 'mikroskopi, kas nav optiskie mikroskopi; difrakcijas aparāti',
    'Lasers, other than laser diodes; other optical appliances and instruments, not specified or included elsewhere in this chapter' => 'Lāzeri, izņemot lāzerdiodes; citas optiskas ierīces un instrumenti, kas citur šajā nodaļā nav minēti vai ietverti',
    'Direction finding compasses; other navigational instruments and appliances' => 'Kompasi virziena noteikšanai; citādi navigācijas instrumenti un ierīces',
    'Surveying (including photogrammetrical surveying), hydrographic, oceanographic, hydrological, meteorological or geophysical instruments and appliances, excluding compasses; rangefinders' => 'Mērniecības (ieskaitot fotogrammetriju), hidrogrāfijas, okeanogrāfijas, hidroloģijas, meteoroloģijas vai ģeofizikas ierīces un instrumenti, izņemot kompasus; tālmēri',
    'Balances of a sensitivity of 5 cg or better, with or without weights' => 'Svari ar 0,05 g vai lielāku jutību, ar atsvariem vai bez tiem',
    'Drawing, marking-out or mathematical calculating instruments (for example, drafting machines, pantographs, protractors, drawing sets, slide rules, disc calculators); instruments for measuring length, for use in the hand (for example, measuring rods and tapes, micrometers, callipers), not specified or included elsewhere in this chapter' => 'Rasēšanas, iezīmēšanas vai skaitļošanas instrumenti un ierīces (piemēram, rasēšanas mašīnas, pantogrāfi, transportētāji, rasetnes, logaritmiskie lineāli, diska kalkulatori u. c.); rokas instrumenti lineāro izmēru mērīšanai (piemēram, mērlatas, mērlentes, mikrometri, kalibri), kas citur šajā nodaļā nav minēti',
    'Instruments and appliances used in medical, surgical, dental or veterinary sciences, including scintigraphic apparatus, other electromedical apparatus and sight-testing instruments' => 'Medicīnas, ķirurģijas, zobārstniecības vai veterinārijas instrumenti un ierīces, ieskaitot scintigrāfijas aparatūru, citāda elektriskā medicīnas aparatūra un ierīces redzes pārbaudei',
    'Mechano-therapy appliances; massage apparatus; psychological aptitude-testing apparatus; ozone therapy, oxygen therapy, aerosol therapy, artificial respiration or other therapeutic respiration apparatus' => 'Mehanoterapijas ierīces; masāžas aparāti; psiholoģisko testu aparatūra profesionalitātes noteikšanai; ozona terapijas, skābekļa terapijas, aerosolterapijas, mākslīgās elpināšanas aparatūra vai citāda ārstnieciskā aparatūra elpošanas ceļu ārstēšanai',
    'Other breathing appliances and gas masks, excluding protective masks having neither mechanical parts nor replaceable filters' => 'Citādi elpošanas aparāti un gāzmaskas, izņemot aizsargmaskas bez mehāniskām daļām un maināmiem filtriem',
    'Orthopaedic appliances, including crutches, surgical belts and trusses; splints and other fracture appliances; artificial parts of the body; hearing aids and other appliances which are worn or carried, or implanted in the body, to compensate for a defect or disability' => 'Ortopēdiskie piederumi, ieskaitot kruķus, ķirurģiskās jostas un bandāžas; šinas un citas palīgierīces kaulu lūzumu ārstēšanai; ķermeņa daļu protēzes; dzirdes aparāti un citas ierīces, ko valkā, nēsā vai implantē ķermenī fiziska defekta vai invaliditātes kompensēšanai',
    'Apparatus based on the use of X-rays or of alpha, beta, gamma or other ionising radiation, whether or not for medical, surgical, dental or veterinary uses, including radiography or radiotherapy apparatus, X-ray tubes and other X-ray generators, high tension generators, control panels and desks, screens, examination or treatment tables, chairs and the like' => 'Aparatūra, kurā izmanto rentgenstarojumu vai α, β γ vai citu jonizējošu starojumu un kas ir vai nav paredzēta izmantošanai medicīnā, ķirurģijā, zobārstniecībā vai veterinārijā, ieskaitot rentgenoloģijas vai radioterapijas aparatūru, rentgenlampas un citus rentgenstarojuma ģeneratorus, augstspiediena ģeneratorus, kontroles pultis un aizsargus, ekrānus, galdus, krēslus un tamlīdzīgas ierīces izmeklēšanai un ārstēšanai',
    'Instruments, apparatus and models, designed for demonstrational purposes (for example, in education or exhibitions), unsuitable for other uses' => 'Instrumenti, aparatūra un modeļi, kas izmantojami demonstrēšanai (piemēram, mācībām vai izstādēm) un nav izmantojami citādi',
    'Machines and appliances for testing the hardness, strength, compressibility, elasticity or other mechanical properties of materials (for example, metals, wood, textiles, paper, plastics)' => 'Mašīnas un ierīces materiālu (piemēram, metālu, koksnes, tekstilmateriālu, papīra, plastmasu) cietības, stiprības, saspiežamības, elastības vai citu mehānisko īpašību pārbaudei',
    'Hydrometers and similar floating instruments, thermometers, pyrometers, barometers, hygrometers and psychrometers, recording or not, and any combination of these instruments' => 'Blīvummēri un tamlīdzīgas šķidrumā iegremdējamas ierīces, termometri, pirometri, barometri, higrometri un psihrometri, ar reģistrācijas kontrolierīcēm vai bez tām, kā arī jebkuri šo ierīču apvienojumi',
    'Instruments and apparatus for measuring or checking the flow, level, pressure or other variables of liquids or gases (for example, flow meters, level gauges, manometers, heat meters), excluding instruments and apparatus of heading 9014, 9015, 9028 or 9032' => 'Ierīces un aparatūra šķidrumu vai gāzu plūsmas (daudzuma), līmeņa, spiediena vai citu mainīgo lielumu mērīšanai vai kontrolei (piemēram, plūsmas mērītāji, līmeņa rādītāji, manometri, siltuma skaitītāji), izņemot instrumentus un aparatūru, kas iekļauti pozīcijā 9014, 9015, 9028 vai 9032',
    'Instruments and apparatus for physical or chemical analysis (for example, polarimeters, refractometers, spectrometers, gas or smoke analysis apparatus); instruments and apparatus for measuring or checking viscosity, porosity, expansion, surface tension or the like; instruments and apparatus for measuring or checking quantities of heat, sound or light (including exposure meters); microtomes' => 'Fizikālās vai ķīmiskās analīzes ierīces un aparatūra (piemēram, polarimetri, refraktometri, spektrometri, gāzes vai dūmu analizatori); ierīces un aparatūra viskozitātes, porainības, izplešanās, virsmas spraiguma u. tml. mērīšanai vai kontrolei; ierīces un aparatūra siltuma, skaņas vai apgaismojuma mērīšanai vai kontrolei (ieskaitot eksponometrus); mikrotomi',
    'Gas, liquid or electricity supply or production meters, including calibrating meters therefor' => 'Saražotās vai patērējamās gāzes, šķidruma vai elektrības skaitītāji, ieskaitot attiecīgos kalibrējošos skaitītājus',
    'Revolution counters, production counters, taximeters, milometers, pedometers and the like; speed indicators and tachometers, other than those of heading 9014 or 9015; stroboscopes' => 'Apgriezienu mērītāji, ieguves mērītāji, taksometri, hodometri, pedometri un tamlīdzīgas ierīces; spidometri un tahometri, izņemot tos, kas iekļauti pozīcijā 9014 vai 9015; stroboskopi',
    'Oscilloscopes, spectrum analysers and other instruments and apparatus for measuring or checking electrical quantities, excluding meters of heading 9028; instruments and apparatus for measuring or detecting alpha, beta, gamma, X-ray, cosmic or other ionising radiation' => 'Osciloskopi, spektrometri un citi instrumenti un aparāti elektrisko lielumu mērīšanai vai kontrolei, izņemot pozīcijas 9028 ierīces; ierīces un aparatūra α, β, γ, rentgena, kosmiskā vai cita jonizējošā starojuma mērīšanai vai konstatēšanai',
    'Measuring or checking instruments, appliances and machines, not specified or included elsewhere in this chapter; profile projectors' => 'Mērīšanas vai kontroles ierīces, palīgierīces un iekārtas, kas citur šajā nodaļā nav minētas vai iekļautas; profilprojektori',
    'Automatic regulating or controlling instruments and apparatus' => 'Automātiskās regulēšanas vai kontroles ierīces un aparatūra',
    'Parts and accessories (not specified or included elsewhere in this chapter) for machines, appliances, instruments or apparatus of Chapter 90' => '90. nodaļā minēto mašīnu, ierīču, instrumentu vai aparatūras daļas un piederumi, kas citur šajā nodaļā nav minēti vai ietverti',
    'Wristwatches, pocket-watches and other watches, including stopwatches, with case of precious metal or of metal clad with precious metal' => 'Rokas pulksteņi, kabatas pulksteņi un citi pulksteņi, ieskaitot hronometrus, ar korpusu no dārgmetāla vai metāla, kas plaķēts ar dārgmetālu',
    'Wristwatches, pocket-watches and other watches, including stopwatches, other than those of heading 9101' => 'Rokas pulksteņi, kabatas pulksteņi un tamlīdzīgi līdznēsājami pulksteņi, ieskaitot hronometrus, izņemot pozīcijā 9101 minētos',
    'Clocks with watch movements, excluding clocks of heading 9104' => 'Stacionāri pulksteņi ar līdznēsājamo pulksteņu mehānismu, izņemot pozīcijas 9104 pulksteņus',
    'Other clocks' => 'Citādi pulksteņi',
    'Time of day recording apparatus and apparatus for measuring, recording or otherwise indicating intervals of time, with clock or watch movement or with synchronous motor (for example, time-registers, time-recorders)' => 'Diennakts laika reģistrēšanas un laika intervālu mērīšanas, reģistrēšanas vai uzrādīšanas aparāti, ar pulksteņa mehānismu vai sinhrono dzinēju (piemēram, darba laika reģistratori, datuma un laika reģistrēšanas ierīces)',
    'Watch movements, complete and assembled' => 'Līdznēsājamo pulksteņu mehānismi, sakomplektēti un samontēti',
    'Clock movements, complete and assembled' => 'Pulksteņu mehānismi, kas nav līdznēsājami, sakomplektēti un samontēti',
    'Complete watch or clock movements, unassembled or partly assembled (movement sets); incomplete watch or clock movements, assembled; rough watch or clock movements' => 'Nesamontēti vai daļēji samontēti sakomplektēti pulksteņmehānismi; nenokomplektēti stacionāro vai līdznēsājamo pulksteņu mehānismi, samontēti; pulksteņu vai rokas pulksteņu mehānismu sagataves',
    'Watch cases and parts thereof' => 'Līdznēsājamo pulksteņu korpusi un to daļas',
    'Clock cases and cases of a similar type for other goods of this chapter, and parts thereof' => 'Korpusi stacionāriem pulksteņiem un tamlīdzīgi korpusi citiem šās nodaļas izstrādājumiem un to daļas',
    'Watch straps, watch bands and watch bracelets, and parts thereof' => 'Līdznēsājamo pulksteņu siksniņas, lentes, rokassprādzes un to daļas',
    'Other clock or watch parts' => 'Citādas pulksteņu daļas',
    'Pianos, including automatic pianos; harpsichords and other keyboard stringed instruments' => 'Klavieres, ieskaitot mehāniskās klavieres; klavesīni un citādi stīgu taustiņinstrumenti',
    'Other string musical instruments (for example, guitars, violins, harps)' => 'Citādi stīgu mūzikas instrumenti (piemēram, ģitāras, vijoles, arfas)',
    'Wind musical instruments (for example, keyboard pipe organs, accordions, clarinets, trumpets, bagpipes), other than fairground organs and mechanical street organs' => 'Pūšamie mūzikas instrumenti (piemēram, taustiņērģeles ar stabulēm, akordeoni, klarnetes, trompetes, dūdas), izņemot orķestrionus un leijerkastes',
    'Musical instruments, the sound of which is produced, or must be amplified, electrically (for example, organs, guitars, accordions)' => 'Mūzikas instrumenti ar skaņas toņfrekvences elektrisko ģeneratoru vai skaņas elektrisko pastiprinātāju (piemēram, ērģeles, ģitāras, akordeoni)',
    'Musical boxes, fairground organs, mechanical street organs, mechanical singing birds, musical saws and other musical instruments not falling within any other heading of this chapter; decoy calls of all kinds; whistles, call horns and other mouth-blown sound signalling instruments' => 'Mūzikas vācelītes, orķestrioni, leijerkastes, mehāniski dziedoši putni, zāģi un citi mūzikas instrumenti, kas nav ietverti nevienā citā šās nodaļas pozīcijā; visu veidu mānekļsvilpes; svilpes, ragi un citi pūšami signālinstrumenti',
    'Parts (for example, mechanisms for musical boxes) and accessories (for example, cards, discs and rolls for mechanical instruments) of musical instruments; metronomes, tuning forks and pitch pipes of all kinds' => 'Mūzikas instrumentu daļas (piemēram, mūzikas vācelīšu mehānismi) un piederumi (piemēram, mehānisko instrumentu kartes, diski un veltnīši); visu veidu metronomi, toņdakšas un toņstabules',
    'Military weapons, other than revolvers, pistols and the arms of heading 9307' => 'Kaujas ieroči, izņemot revolverus, pistoles un pozīcijas 9307 ieročus',
    'Other firearms and similar devices which operate by the firing of an explosive charge (for example, sporting shotguns and rifles, muzzle-loading firearms, Very pistols and other devices designed to project only signal flares, pistols and revolvers for firing blank ammunition, captive-bolt humane killers, line-throwing guns)' => 'Citi šaujamieroči un tamlīdzīgas ierīces, ko darbina sprāgstošs lādiņš (piemēram, medību bises un sporta šautenes, pa stobru lādējami šaujamieroči, raķešpistoles un citas ierīces signālraķešu palaišanai, salūtpatronu pistoles un revolveri, kaušanas ierīces, auklas izšaušanas ierīces)',
    'Parts and accessories of articles of headings 9301 to 9304' => 'Daļas un piederumi pozīciju 9301–9304 izstrādājumiem',
    'Bombs, grenades, torpedoes, mines, missiles and similar munitions of war and parts thereof; cartridges and other ammunition and projectiles and parts thereof, including shot and cartridge wads' => 'Bumbas, granātas, torpēdas, mīnas, raķetes un tamlīdzīga kara munīcija un tās daļas; patronas un cita munīcija un šāviņi un to daļas, ieskaitot skrotis un patronu prapjus',
    'Seats (other than those of heading 9402), whether or not convertible into beds, and parts thereof' => 'Sēdekļi (izņemot pozīcijā 9402 minētos), arī par gultām pārveidojamie, un to daļas',
    'Medical, surgical, dental or veterinary furniture (for example, operating tables, examination tables, hospital beds with mechanical fittings, dentists\' chairs); barbers\' chairs and similar chairs, having rotating as well as both reclining and elevating movements; parts of the foregoing articles' => 'Mēbeles medicīnas, ķirurģijas, zobārstniecības vai veterinārijas vajadzībām (piemēram, operāciju galdi, izmeklēšanas galdi, slimnīcu gultas ar mehāniskiem piederumiem, zobārstu krēsli); frizētavu krēsli un tamlīdzīgi krēsli, ko var grozīt, atgāzt un pacelt; iepriekš minēto izstrādājumu daļas',
    'Other furniture and parts thereof' => 'Citādas mēbeles un to daļas',
    'Mattress supports; articles of bedding and similar furnishing (for example, mattresses, quilts, eiderdowns, cushions, pouffes and pillows) fitted with springs or stuffed or internally fitted with any material or of cellular rubber or plastics, whether or not covered' => 'Matraču pamatnes; gultas piederumi un tamlīdzīgi izstrādājumi (piemēram, matrači, segas, vatētas segas, dūnu segas, dīvānspilveni, pufi un spilveni) ar atsperēm vai pildīti ar jebkuru materiālu, vai no porainas gumijas vai plastmasas, arī apvilkti',
    'Luminaires and lighting fittings including searchlights and spotlights and parts thereof, not elsewhere specified or included; illuminated signs, illuminated nameplates and the like, having a permanently fixed light source, and parts thereof not elsewhere specified or included' => 'Gaismekļi un apgaismes piederumi, ieskaitot prožektorus, starmešus un to daļas, kas citur nav minētas un iekļautas; izgaismotas izkārtnes, tablo un tamlīdzīgi izstrādājumi, kuros iemontēts stacionārs gaismas avots, to daļas, kas citur nav minētas',
    'Prefabricated buildings' => 'Saliekamās būvkonstrukcijas',
    'Tricycles, scooters, pedal cars and similar wheeled toys; dolls\' carriages; dolls; other toys; reduced-size (scale) models and similar recreational models, working or not; puzzles of all kinds' => 'Trīsriteņi, skrejrati, pedāļautomobiļi un tamlīdzīgi rotaļu braucamrīki ar riteņiem; leļļu ratiņi; lelles; citas rotaļlietas; samazināti modeļi (mērogā) un tamlīdzīgi izklaidei paredzēti modeļi, kustīgi vai nekustīgi; visu veidu mozaīkmīklas',
    'Video game consoles and machines, table or parlour games, including pintables, billiards, special tables for casino games and automatic bowling equipment, amusement machines operated by coins, banknotes, bank cards, tokens or by any other means of payment' => 'Videospēļu konsoles un iekārtas, galda vai istabas spēles, ieskaitot mehāniski darbināmas, biljarda galdi, īpaši galdi kazino spēlēm un automātiskas ķegļu iekārtas, izklaides iekārtas, ko darbina ar monētām, banknotēm, bankas kartēm, žetoniem vai citādiem maksāšanas līdzekļiem',
    'Festive, carnival or other entertainment articles, including conjuring tricks and novelty jokes' => 'Karnevāla un citi svētku un izklaides izstrādājumi, ieskaitot priekšmetus burvju mākslas un triku rādīšanai',
    'Articles and equipment for general physical exercise, gymnastics, athletics, other sports (including table tennis) or outdoor games, not specified or included elsewhere in this chapter; swimming pools and paddling pools' => 'Vingrošanas, vieglatlētikas, smagatlētikas, citu sporta veidu (ieskaitot galda tenisu), brīvā dabā spēlējamo spēļu rīki un inventārs, kas citur šajā nodaļā nav minēts; peldbaseini un rotaļu baseini',
    'Fishing rods, fish-hooks and other line fishing tackle; fish landing nets, butterfly nets and similar nets; decoy birds (other than those of heading 9208 or 9705) and similar hunting or shooting requisites' => 'Makšķeres, āķi un citi makšķerēšanas rīki; zivju tīkliņi, tīkli taureņu ķeršanai un tamlīdzīgi tīkli; mānekļi putnu atlējumu veidā (izņemot pozīcijā 9208 vai 9705 minētos) un tamlīdzīgi medību vai šaušanas piederumi',
    'Travelling circuses and travelling menageries; amusement park rides and water park amusements; fairground amusements, including shooting galleries; travelling theatres' => 'Ceļojošie cirki un ceļojošās zvērnīcas; atrakciju parku atrakcijas un ūdens atrakciju parku atrakcijas; gadatirgu atrakcijas, ietverot šautuves; ceļojošie teātri',
    'Worked ivory, bone, tortoiseshell, horn, antlers, coral, mother-of-pearl and other animal carving material, and articles of these materials (including articles obtained by moulding)' => 'Apstrādāts ziloņkauls, kauls, bruņurupuča bruņas, ragi, briežu ragi, koraļļi, perlamutrs un citādi dzīvnieku izcelsmes materiāli griešanai un izstrādājumi no šiem materiāliem (ieskaitot veidnēs darinātus izstrādājumus)',
    'Brooms, brushes (including brushes constituting parts of machines, appliances or vehicles), hand-operated mechanical floor sweepers, not motorised, mops and feather dusters; prepared knots and tufts for broom or brush making; paint pads and rollers; squeegees (other than roller squeegees)' => 'Slotas, sukas (ieskaitot sukas, kas ir mehānismu, ierīču vai transportlīdzekļu daļas), ar roku darbināmi mehāniskie bezmotora grīdas tīrītāji, beržamās sukas, spalvu slotas un putekļu slotiņas; zari un saišķi, kas sagatavoti slotu vai suku izgatavošanai; krāsotāju spilventiņi un veltnīši; gumijas skrāpji (izņemot rullīšu veida skrāpjus)',
    'Buttons, press-fasteners, snap-fasteners and press studs, button moulds and other parts of these articles; button blanks' => 'Pogas, spiedpogas, spraudpogas, pogu veidnes un citas šo izstrādājumu daļas; pogu sagataves',
